import React, { Fragment } from "react";
import { Link, Route } from "react-router-dom";
import { writeSync } from "fs";

export default ({ writers }) => (
  <Fragment>
    <ul>
      {writeSync.map(writer => (
        <li>
          <Link to="">name</Link>
        </li>
      ))}
    </ul>
  </Fragment>
);
